import React from "react";

const Cart = ({ cart }) => {
    return (
        <div>
            <h2>Carrito de Compras</h2>
            {cart.length === 0 ? (
                <p>No hay productos en el carrito</p>
            ) : (
                <ul>
                    {cart.map((item, index) => (
                        <li key={index}>
                            <h3>{item.title}</h3>
                            <p>Precio: ${item.price}</p>
                            <p>Categor√≠a: {item.category}</p>
                        </li>
                    ))}
                </ul>
            )}
        </div>
    );
};

export default Cart;
